import React from 'react';
import './inputbox.css';

const InputBox = ({ width, height, fontSize, placeHolder, }) => {

    const inputBoxStyle = {
        width: width,
        height: height,
    };

  return (
    <div className='input-box' style={inputBoxStyle}>
        <input className='input-box-input' placeholder={placeHolder} style={{fontSize: fontSize}} />
    </div>
  )
};

export default InputBox;
